import styled from "styled-components";

const MainConteiner = styled.div``;

const IconsConteiner = styled.div`
  padding-left: 15px;
  margin-top: 23px;
  display: flex;
  grid-gap: 5px;
`;

const Vector = styled.div`
  height: 1px;
  border-top: solid 1.7px #060606;
  margin-top: 23px;
`;
